import aiohttp
import asyncio
from gidgethub import aiohttp as gh_aiohttp
import githubid
import json

PADDLE_DEPART = githubid.PADDLE_DEPART
OTHER_DEPART = githubid.OTHER_DEPART
INTEL = githubid.INTEL
NOT_KONW = githubid.NOT_KONW

PADDLE_DEPART_lower = []
OTHER_DEPART_lower = []
INTEL_low = []
NOT_KONW_low = []
for i in PADDLE_DEPART:
    PADDLE_DEPART_lower.append(i.lower())
for i in OTHER_DEPART:
    OTHER_DEPART_lower.append(i.lower())
for i in INTEL:
    INTEL_low.append(i.lower())
for i in NOT_KONW:
    NOT_KONW_low.append(i.lower())   

def getNextUrl(link):
    next_str = None
    for i in link.split(','):
        if 'rel="next"' in i:
            next_str = i
            break
    if next_str != None:
        start_index = next_str.index('<')
        end_index = next_str.index('>')
        url = next_str[start_index+1:end_index]
    else:
        url = None
    return url

async def recognition(url, gh):
    PR_NOT_PADDLE_DEPART_close = {}
    PR_NOT_PADDLE_DEPART_merge = {}
    PR_IN_OTHER_DEPART_close = {}
    PR_IN_OTHER_DEPART_merge = {}
    while (url != None):
        (code, header, body) = await gh._request("GET", url, {'accept': 'application/vnd.github.antiope-preview+json', 'authorization': "Basic bGVsZWxlbGVsZXo6bXVzaWNqYXk4ODY2NTk="})
        res = json.loads(body.decode('utf8'))
        for item in res:
            user = item['user']['login'].lower()
            creatTime = item['created_at'].split('T')[0]
            if user not in PADDLE_DEPART_lower and user not in INTEL_low and user not in NOT_KONW_low:
                PR_NUM = item['number']
                mergeTime = item['merged_at']
                if mergeTime != None: ##merge
                    if user in OTHER_DEPART_lower:              
                        if user not in PR_IN_OTHER_DEPART_merge:
                            PR_IN_OTHER_DEPART_merge[user] = []
                        value = '%s: %s' %(PR_NUM, creatTime)                
                        PR_IN_OTHER_DEPART_merge[user].append(value)
                    else:
                        if user not in PR_NOT_PADDLE_DEPART_merge:
                            PR_NOT_PADDLE_DEPART_merge[user] = []
                        value = '%s: %s' %(PR_NUM, creatTime)
                        PR_NOT_PADDLE_DEPART_merge[user].append(value)
                else:
                    if user in OTHER_DEPART_lower:              
                        if user not in PR_IN_OTHER_DEPART_close:
                            PR_IN_OTHER_DEPART_close[user] = []
                        value = '%s: %s' %(PR_NUM, creatTime)                
                        PR_IN_OTHER_DEPART_close[user].append(value)
                    else:
                        if user not in PR_NOT_PADDLE_DEPART_close:
                            PR_NOT_PADDLE_DEPART_close[user] = []
                        value = '%s: %s' %(PR_NUM, creatTime)
                        PR_NOT_PADDLE_DEPART_close[user].append(value)
        print("PR_NOT_PADDLE_DEPART_merge: %s" %PR_NOT_PADDLE_DEPART_merge)
        print("PR_NOT_PADDLE_DEPART_close: %s" %PR_NOT_PADDLE_DEPART_close)
        print("PR_IN_OTHER_DEPART_close: %s" %PR_IN_OTHER_DEPART_close)
        print("PR_IN_OTHER_DEPART_merge: %s" %PR_IN_OTHER_DEPART_merge)
        url = getNextUrl(header['link'])
        print(url)
        #url = None
    '''
    print("PR_NOT_PADDLE_DEPART: %s" %PR_NOT_PADDLE_DEPART)
    print(len(PR_NOT_PADDLE_DEPART))
    print("PR_IN_OTHER_DEPART: %s" %PR_IN_OTHER_DEPART)
    '''
    print("PR_NOT_PADDLE_DEPART_merge: %s" %PR_NOT_PADDLE_DEPART_merge)
    print("PR_NOT_PADDLE_DEPART_close: %s" %PR_NOT_PADDLE_DEPART_close)
    print("PR_IN_OTHER_DEPART_close: %s" %PR_IN_OTHER_DEPART_close)
    print("PR_IN_OTHER_DEPART_merge: %s" %PR_IN_OTHER_DEPART_merge)

    for key in [PR_NOT_PADDLE_DEPART_merge, PR_NOT_PADDLE_DEPART_close, PR_IN_OTHER_DEPART_close, PR_IN_OTHER_DEPART_merge]:
        print('=====================')
        for i in key:
            print("%s: %s" %(i, key[i]))


async def main(user, repo):
    async with aiohttp.ClientSession() as session:
        gh = gh_aiohttp.GitHubAPI(session, user)
        #pr_url = 'https://api.github.com/repos/%s/%s/pulls?per_page=100&page=1&direction=asc&q=addClass' %(user, repo)
        #close
        pr_url = 'https://api.github.com/repos/%s/%s/pulls?per_page=100&page=1&direction=asc&q=addClass&state=close' %(user, repo)
        await recognition(pr_url, gh)

def PR_job():
    new_loop = asyncio.new_event_loop()
    asyncio.set_event_loop(new_loop)
    loop = asyncio.get_event_loop()
    loop.run_until_complete(main('PaddlePaddle', 'Paddle'))
